        body {

            font-family: 'CentraNube', Roboto, -apple-system, BlinkMacSystemFont, sans-serif;
        }
        *{
            font-family: 'CentraNube', Roboto, -apple-system, BlinkMacSystemFont, sans-serif;
        }
        a{
            color: #fff;
            transition: all .5s cubic-bezier(.16,.68,.43,.99);
        }
        a:hover{
            color: #fff;
            opacity: 0.8;
            transition: all .5s cubic-bezier(.16,.68,.43,.99);
        }

        .store-bar {  
            background:#2D2938; 
            color: white;
            height: 40px;
            overflow: hidden;
            padding:5px 0; 
            position: absolute;
            right: 0;
            top: 0; 
            width: 100%;
            transition: all .5s cubic-bezier(.16,.68,.43,.99);
        }
        .store-bar-reduced{
            transition: all .5s cubic-bezier(.16,.68,.43,.99);
            width: 40px;
        }
        .store-bar-reduced .svg-icon{
            transition: all .5s cubic-bezier(.16,.68,.43,.99);
            transform: rotate(45deg);
        }
        .logo { 
            margin-top: 2px;
            width: 110px;
        }
        .svg-icon{
            display: inline-block;
            fill: #fff;
            height: 20px;
            top: 7px;
            transition: all .5s cubic-bezier(.16,.68,.43,.99);
            width: 15px;
        }
        .svg-icon-medium{
            width: 16px;
        }
        .icon-left{
            left: 10px;
            top: 6px;
        }
        .icon-right { 
            right:10px; 
            top:8px; 
        }
        .misc-shape-1{
            left: -10px;
            top: -34px;
            width: 50px;
        }
        .store-bar-reduced .misc-shape-1{
            top: -40px;
            transition: all .5s cubic-bezier(.16,.68,.43,.99);
        }
        .misc-shape-2{
            left: 10%;
            top: 14px;
            width: 270px; 
        }
        .misc-shape-3{
            -ms-transform: rotate(90deg);
            -webkit-transform: rotate(90deg);
            right: -90px;
            top: 15px;
            transform: rotate(90deg);
            width: 200px;
        }

        .button {
            border-radius: 4px; 
            margin-top: 1px;
            padding: 5px;
            text-transform: none;
            border-color: white;
            color: white;
        }
        .back-link{
            display: inline-block;
            font-size: 16px;
            margin: 4px 0 0 25px;
        }
        
        @media (max-width: 767px) {
            .icon-left{
                left: 6px;
                top: 6px;
            }
            .svg-icon-medium {
                width: 16px;
            }
            .back-link{
                font-size: 14px;
                margin: 5px 0 0 13px;
            }
            .misc-shape-2 {
                left: 15%;
                top: 27px;
                width: 180px;
            }
            .misc-shape-3 {
                right: -100px;
                top: 20px;
            }
        }
    </style>
